import React from 'react';

export const ResetPasswordPageConfig = {
    settings: {
        layout: {
            config: {}
        }
    },
    routes  : [
        {
            path     : '/reset-password',
            component: React.lazy(() => import('./ResetPasswordPage'))
        }
    ]
};
